import React, { useState, useEffect } from "react";
import "./main.css";
import "./App.css";
import breakfastData from "./breakfastData";

function FormComponent({ formData, imageExists, handleChange, handleClick }) {
    const [number, setNumber] = useState("");
    const handleInputChange = (event) => {
        const value = event.target.value.replace(/\D/g, "");
        setNumber(value);
        handleChange(event);
    };

    return (
        <tr key={formData.id}>
            <td>{formData.name}</td>
            <td>{formData.colour}</td>
            <td>
                <div>${formData.pricePerKg}</div>
                <div>
                    <input
                        type="text"
                        value={number}
                        onChange={handleInputChange}
                        placeholder="Enter a number"
                    />
                </div>
                <div>Total Price: ${(formData.pricePerKg * number) / 1000}</div>
            </td>
            <td>
                {imageExists && (
                    <img src={"/" + formData.name + ".png"} alt="xdd"></img>
                )}
            </td>
        </tr>
    );
}

function App() {
    const [_, setNumber] = useState("");
    const [formDataList, setFormDataList] = useState([]);
    const [imageExists, setImageExists] = useState(true);
    const staticFileList = ["cheese", "cheese2", "cheese3"];
    const [makeTable, setMakeTable] = useState(false);
    const [counter, setCounter] = useState(1);

    useEffect(() => {
        const runHandleClick = () => {
            if (formDataList.length < 5) {
                handleClick(breakfastData);
            }
        };

        runHandleClick();
        console.log("formDataList", formDataList);

        return () => {};
    }, [formDataList]);

    function updateCounter() {
        if (counter === 5) {
            setCounter(1);
        } else {
            setCounter(counter + 1);
        }
    }

    function handleClick(bodyData) {
        // const breakfastData = {
        //     name: "cheese", // You may want to generate unique names for each form
        //     colour: "yellow",
        //     pricePerKg: 10.0,
        //     imgUrl: "www",
        // };
        fetch("https://localhost:7089/breakfasts", {
            method: "POST",
            headers: {
                "Content-Type": "application/json",
            },
            body: JSON.stringify(breakfastData),
        })
            .then((response) => {
                if (!response.ok) {
                    throw new Error("Network response was not ok");
                } else {
                    response.json().then((json) => {
                        setFormDataList([...formDataList, json]);
                    });
                }
            })
            .catch((error) => {
                console.error(
                    "There was a problem with your fetch operation:",
                    error
                );
            });
    }

    function getPosts() {
        fetch(
            "https://localhost:7089/breakfasts/a07898b0-fffa-439c-944e-216893ddec8e"
        )
            .then((response) => {
                if (!response.ok) {
                    throw new Error("Network response was not ok");
                }
                return response.json();
            })
            .then((json) => {
                setFormDataList([json]);
                if (json.name && staticFileList.includes(json.name)) {
                    setImageExists(true);
                } else {
                    setImageExists(false);
                }
            })
            .catch((error) => {
                if (error.message === "Failed to fetch") {
                    console.error(
                        "Error: Failed to fetch. Is the server running?"
                    );
                } else {
                    console.error(
                        "There was a problem with your fetch operation:",
                        error
                    );
                }
            });
    }

    function generateTable() {
        setMakeTable(true);
    }

    const handleChange = (event) => {
        const value = event.target.value.replace(/\D/g, "");
        setNumber(value);
    };

    return (
        <div className="container">
            <h1 className="title">HTTP Request</h1>
            <button className="btn" onClick={handleClick}>
                Get all posts
            </button>
            <button className="btn" onClick={getPosts}>
                Get posts
            </button>
            <button className="btn" onClick={generateTable}>
                Make Table
            </button>
            {makeTable && (
                <table>
                    <thead>
                        <tr>
                            <th>Name</th>
                            <th>Colour</th>
                            <th>Price Per Kg</th>
                            <th>Image</th>
                        </tr>
                    </thead>
                    <tbody>
                        {formDataList.map((formData) => (
                            <FormComponent
                                key={formData.id}
                                formData={formData}
                                imageExists={imageExists}
                                handleChange={handleChange}
                                handleClick={handleClick}
                            />
                        ))}
                    </tbody>
                </table>
            )}
        </div>
    );
}

export default App;
